#include <stdio.h>
#include <stdlib.h>
#include <string.h>

#define MAX_SIZE 100

int main() {
    char expression[MAX_SIZE];
    char *token;
    int stack[MAX_SIZE];
    int top = 0;

    fgets(expression, MAX_SIZE, stdin);
    expression[strcspn(expression, "\n")] = 0;

    token = strtok(expression, " ");
    while (token != NULL) {
        int operand = atoi(token);
        if (operand >= 0 && operand < 100000000) {
            stack[top++] = operand;
        } else {
            int operand2 = stack[--top];
            int operand1 = stack[--top];

            switch (operand) {
                case '+':
                    stack[top++] = operand1 + operand2;
                    break;
                case '-':
                    stack[top++] = operand1 - operand2;
                    break;
                case '*':
                    stack[top++] = operand1 * operand2;
                    break;
            }
        }
        token = strtok(NULL, " ");
    }

    printf("%d\n", stack[0]);

    return 0;
}
